choices.text:
COSBase cosBase = getObject( i );
float f = 0.0f;
if( cosBase instanceof COSFloat )
{
    f = ((COSFloat)cosBase).floatValue();
}
else if( cosBase instanceof COSInteger )
{
    f = ((COSInteger)cosBase).floatValue();
}
retval[i] = f;

